import { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { IActive, setActiveUsers } from '../../store/slices/activeUsers';
import { Rootstate } from '../../store/store';

const ActiveUsers: React.FC = () => {
	const dispatch = useDispatch();
	const activeUsers = useSelector((state: Rootstate) => state.activeUsers);

	useEffect(() => {
		const fetchData = async () => {
			try {
				const response = await fetch('http://localhost:8000/login', {
					method: 'GET',
				});
				const data = await response.json();
				dispatch(setActiveUsers(data));
			} catch (err) {
				console.log(err);
			}
		};

		fetchData();
	}, [dispatch]);
	console.log(activeUsers.value);
	return (
		<div>
			<h1>Active Users</h1>
			{/* <ul>
				{activeUsers.map((user: IActive) => (
					<li key={user.email}>{user.password}</li>
				))}
			</ul> */}
		</div>
	);
};

export default ActiveUsers;
